    name: "H\u01b0\u1edbng d\u1eabn s\u1eed d\u1ee5ng",
    value:
      "<p>H\u01b0\u1edbng D\u1eabn S\u1eed D\u1ee5ng B\u00ecnh n\u01b0\u1edbc gi\u1eef nhi\u1ec7t inox 304 cao c\u00e2p phong c\u00e1ch Nh\u1eadt B\u1ea3n c\u1ed5 trang - YOGA QG</p>\n<p>1. Tr\u01b0\u1edbc khi s\u1eed d\u1ee5ng b\u00ecnh gi\u1eef nhi\u1ec7t, n\u00ean ng\u00e2m b\u00ecnh n\u01b0\u1edbc trong n\u01b0\u1edbc n\u00f3ng v\u1edbi 1 th\u00eca mu\u1ed1i ho\u1eb7c tr\u00e0 xanh kho\u1ea3ng 15 - 20 ph\u00fat \u0111\u1ec3 kh\u1eed m\u00f9i, r\u1eeda b\u00ecnh v\u00e0 gi\u00fap t\u0103ng \u0111\u1ed9 b\u1ec1n \u0111\u1ed9 gi\u1eef nhi\u1ec7t c\u1ee7a b\u00ecnh \u0111\u1ef1ng n\u01b0\u1edbc v\u1ec1 sau. L\u01b0\u1ee3ng n\u01b0\u1edbc trong b\u00ecnh n\u00ean th\u1ea5p h\u01a1n c\u1ed5 b\u00ecnh kho\u1ea3ng 2 cm.</p>\n<p>2. Sau m\u1ed7i l\u1ea7n s\u1eed d\u1ee5ng, n\u00ean r\u1eeda s\u1ea1ch b\u00ecnh gi\u1eef nhi\u1ec7t v\u00e0 \u0111\u1ec3 b\u00ecnh n\u01b0\u1edbc kh\u00f4 ho\u00e0n to\u00e0n tr\u01b0\u1edbc khi s\u1eed d\u1ee5ng l\u1ea7n ti\u1ebfp theo \u0111\u1ec3 b\u00ecnh kh\u00f4ng b\u1ecb b\u00e1m m\u00f9i.</p>\n<p>3. Khi v\u1ec7 sinh b\u00ecnh gi\u1eef nhi\u1ec7t, n\u00ean s\u1eed d\u1ee5ng m\u1ed9t mi\u1ebfng v\u1ea3i m\u1ec1m \u0111\u1ec3 tr\u00e1nh l\u00e0m x\u1ea7y x\u01b0\u1edbc b\u00ean trong b\u00ecnh. Tr\u00e1nh \u0111\u1ec3 n\u01b0\u1edbc d\u00ednh tr\u00ean b\u1ec1 m\u1eb7t \u0111\u00e8n led \u1edf n\u1eafp b\u00ecnh \u0111\u1ec3 b\u1ea3o \u0111\u1ea3m \u0111\u1ed9 b\u1ec1n v\u00e0 nh\u1ea1y cho LED.</p>",
