    value:
      "<ul>\n<li>R\u1eeda s\u1ea1ch b\u1eb1ng n\u01b0\u1edbc \u1ea5m ho\u1eb7c l\u1ea1nh tr\u01b0\u1edbc khi s\u1eed d\u1ee5ng s\u1ebd duy tr\u00ec \u0111\u01b0\u1ee3c hi\u1ec7u qu\u1ea3 gi\u1eef n\u00f3ng ho\u1eb7c gi\u1eef l\u1ea1nh c\u1ee7a s\u1ea3n ph\u1ea9m.</li>\n<li>\u0110\u1ed5 n\u01b0\u1edbc \u0111\u1ea7y b\u00ecnh \u0111\u1ebfn khi c\u00e1ch mi\u1ec7ng c\u1ed1c 2cm, \u0111\u1ec3 n\u1eafp b\u00ecnh th\u1eb3ng, kh\u1edbp v\u1edbi th\u00e2n b\u00ecnh r\u1ed3i \u0111\u00f3ng l\u1ea1i.</li>\n<li>B\u00ecnh n\u01b0\u1edbc kh\u00f4ng g\u1ec9 nh\u01b0ng c\u0169ng c\u00f3 th\u1ec3 xu\u1ea5t hi\u1ec7n nh\u1eefng \u0111\u1ed1m m\u00e0u \u0111\u1ecf do n\u01b0\u1edbc. Khi \u0111\u00f3, ch\u1ec9 c\u1ea7n cho d\u1ea5m v\u00e0o n\u01b0\u1edbc \u1ea5m, \u0111\u1ed5 \u0111\u1ea7y b\u00ecnh, kh\u00f4ng c\u1ea7n \u0111\u1eady n\u1eafp, gi\u1eef kho\u1ea3ng 30 ph\u00fat, sau \u0111\u00f3 r\u1eeda s\u1ea1ch b\u1eb1ng mi\u1ebfng x\u1ed1p m\u1ec1m th\u00ec c\u00e1c v\u1ebft \u0111\u1ed1m s\u1ebd bi\u1ebfn m\u1ea5t.</li>\n<li>Tr\u00e1nh l\u00e0m r\u01a1i s\u1ea3n ph\u1ea9m.\u00a0</li>\n<li>Kh\u00f4ng s\u1eed d\u1ee5ng trong l\u00f2 vi s\u00f3ng, m\u00e1y r\u1eeda b\u00e1t.\u00a0</li>\n<li>Kh\u00f4ng n\u00ean d\u00f9ng v\u1eadt c\u1ee9ng \u0111\u1ec3 ch\u00f9i r\u1eeda b\u00ecnh.\u00a0</li>\n<li>Kh\u00f4ng kh\u1eed tr\u00f9ng n\u1eafp b\u00ecnh b\u1eb1ng c\u00e1ch lu\u1ed9c l\u00ean.</li>\n</ul>",
