      '<p><span style="color:#000000;font-family:Lato;font-size:40px;font-style:normal;font-weight:500;letter-spacing:normal;text-align:center;text-indent:0px;text-transform:none;white-space:pre-wrap;word-spacing:0px;background-color:#ffffff;float:none;">Ch\u1ea5t li\u1ec7u : Inox 304</span></p>',
