    name: "K\u00edch th\u01b0\u1edbc",
    value:
      "<p>T\u00cdNH N\u0102NG S\u1ea2N PH\u1ea8M:<br />[PHI\u00caN B\u1ea2N QU\u1ed0C T\u1ebe (TI\u1ebeNG ANH) - PHI\u00caN B\u1ea2N M\u1edaI NH\u1ea4T]</p>\n<p>HI\u1ec6U \u1ee8NG \u0110\u00c8N LED RGB: <br />- T\u00edch h\u1ee3p \u00e1nh s\u00e1ng RGB gia t\u0103ng tr\u1ea3i nghi\u1ec7m ch\u01a1i game.</p>\n<p>CH\u1ebe \u0110\u1ed8 CH\u01a0I GAME CH\u1edaI C\u00d4NG NGH\u1ec6 \u00c2M THANH H+: <br />- Hi\u1ec7u \u1ee9ng \u00e2m thanh H+ \u0111\u01b0\u1ee3c \u0111i\u1ec1u ch\u1ec9nh \u0111\u1eb7c bi\u1ec7t v\u00e0 \u0111\u1ed9 tr\u1ec5 c\u1ef1c th\u1ea5p 60ms, mang \u0111\u1ebfn c\u1ea3m gi\u00e1c ch\u00e2n th\u1ef1c v\u00e0 gi\u00e0nh \u01b0u th\u1ebf khi trong tr\u1eadn game.</p>\n<p>C\u00d4NG NGH\u1ec6 KH\u1eec T\u1ea0P \u00c2M HYBRID ANC (-38dB)<br />- C\u00f4ng ngh\u1ec7 ch\u1ed1ng \u1ed3n ch\u1ee7 \u0111\u1ed9ng n\u00e0y gi\u00fap lo\u1ea1i b\u1ecf t\u1ed1t k\u1ec3 c\u1ea3 nh\u1eefng ti\u1ebfng \u1ed3n nh\u1ecf v\u00e0 ti\u1ebfng \u1ed3n l\u1edbn. GX7 s\u1eed dung h\u1ec7 th\u1ed1ng Micro k\u00e9p \u0111\u1ec3 thu th\u1eadp ti\u1ebfng \u1ed3n c\u1ea3 trong v\u00e0 ngo\u00e0i tai, mang \u0111\u1ebfn \u00e2m thanh trong tr\u1ebbo v\u00e0 s\u1eafc n\u00e9t nh\u1ea5t.</p>\n<p>DUAL MIC ENC - CHO CH\u1ea4T L\u01af\u1ee2NG CU\u1ed8C G\u1eccI R\u00d5 R\u00c0NG<br />- Tai nghe GX7 \u0111\u01b0\u1ee3c trang b\u1ecb hai micro \u2013 m\u1ed9t c\u00e1i \u1edf g\u1ea7n mi\u1ec7ng (ph\u00eda d\u01b0\u1edbi tai nghe) v\u00e0 m\u1ed9t c\u00e1i micro \u1edf xa mi\u1ec7ng (ph\u00eda tr\u00ean tai nghe), khi ng\u01b0\u1eddi d\u00f9ng \u0111eo tai nghe \u0111\u1ec3 \u0111\u00e0m tho\u1ea1i, micro ph\u00eda d\u01b0\u1edbi s\u1ebd ph\u1ee5 tr\u00e1ch ghi l\u1ea1i gi\u1ecdng n\u00f3i c\u1ee7a ng\u01b0\u1eddi s\u1eed d\u1ee5ng tai nghe, trong khi micro \u1edf tr\u00ean s\u1ebd t\u00ednh to\u00e1n ch\u00ednh x\u00e1c h\u01b0\u1edbng ng\u01b0\u1eddi g\u1ecdi, <br />- Gi\u00fap ng\u0103n ch\u1eb7n ti\u1ebfng \u1ed3n hi\u1ec7u qu\u00e1 90%, gi\u1ea3m ti\u1ebfng \u1ed3n m\u00f4i tr\u01b0\u1eddng 35dB. Ng\u01b0\u1eddi \u0111ang th\u1ef1c hi\u1ec7n cu\u1ed9c g\u1ecdi v\u1edbi b\u1ea1n s\u1ebd nghe \u0111\u01b0\u1ee3c gi\u1ecdng c\u1ee7a b\u1ea1n r\u00f5 h\u01a1n.</p>\n<p>AMBIENT SOUND MODE<br />- \u0110\u1ec3 nghe nh\u1ea1c m\u00e0 kh\u00f4ng b\u1ecb \u1ea3nh h\u01b0\u1edfng b\u1edfi ti\u1ebfng \u1ed3n b\u00ean ngo\u00e0i, b\u1ea1n h\u00e3y b\u1eadt ch\u1ee9c n\u0103ng ch\u1ed1ng \u1ed3n, c\u00f2n n\u1ebfu b\u1ea1n mu\u1ed1n nghe \u0111\u01b0\u1ee3c \u00e2m thanh xung quanh, h\u00e3y b\u1eadt Ambient Sound Mode (Ch\u1ebf \u0111\u1ed9 \u00e2m thanh xung quanh).<br />- Ng\u01b0\u1eddi d\u00f9ng s\u1ebd tho\u1ea3i m\u00e1i s\u1eed d\u1ee5ng tai nghe b\u1eb1ng c\u00e1ch linh ho\u1ea1t \u0111i\u1ec1u ch\u1ec9nh 2 ch\u1ebf \u0111\u1ed9 n\u00e0y cho ph\u00f9 h\u1ee3p v\u1edbi t\u1eebng tr\u01b0\u1eddng h\u1ee3p.</p>\n<p>26 GI\u1edc PH\u00c1T NH\u1ea0C LI\u00caN T\u1ee4C<br />- Tai nghe bluetooth Edifier GX7 cho kh\u1ea3 n\u0103ng ch\u01a1i nh\u1ea1c \u1ea5n t\u01b0\u1ee3ng v\u1edbi th\u1eddi l\u01b0\u1ee3ng pin l\u1edbn l\u00ean \u0111\u1ebfn 26 gi\u1edd:<br />B\u1eadt ch\u1ebf \u0111\u1ed9 ch\u1ed1ng \u1ed3n:<br />\u2022 5 gi\u1edd (tai nghe)<br />\u2022 15 gi\u1edd (h\u1ed9p s\u1ea1c)<br />Kh\u00f4ng b\u1eadt ch\u1ebf \u0111\u1ed9 ch\u1ed1ng \u1ed3n:<br />\u2022 6.5 gi\u1edd (tai nghe)<br />\u2022 19.5 gi\u1edd (h\u1ed9p s\u1ea1c)</p>\n<p>APP T\u00d9Y CH\u1ec8NH EDIFIER CONNECT<br />- \u1ee8ng d\u1ee5ng Edifier Connect cho ph\u00e9p ng\u01b0\u1eddi d\u00f9ng \u0111i\u1ec1u ch\u1ec9nh m\u1ee9c \u00e2m tr\u1ea7m, ch\u1ebf \u0111\u1ed9 kh\u1eed ti\u1ebfng \u1ed3n c\u0169ng nh\u01b0 mang \u0111\u1ebfn c\u00e1c c\u00e0i \u0111\u1eb7t kh\u00e1c cho tai nghe.</p>\n<p>CHU\u1ea8N CH\u1ed0NG N\u01af\u1edaC - CH\u1ed0NG B\u1ee4I IP54<br />- Tai nghe s\u1edf h\u1eefu ti\u00eau chu\u1ea9n IP54 v\u00e0 v\u1ecf b\u1ecdc nano kh\u00f4ng th\u1ea5m n\u01b0\u1edbc, GX7 c\u00f3 th\u1ec3 ch\u1ecbu \u0111\u01b0\u1ee3c m\u01b0a l\u1edbn v\u00e0 m\u1ed3 h\u00f4i, ph\u00f9 h\u1ee3p cho luy\u1ec7n t\u1eadp, ho\u1ea1t \u0111\u1ed9ng ngo\u00e0i tr\u1eddi c\u1ea3 ng\u00e0y.</p>\n<p>C\u1ed4NG S\u1ea0C TYPE-C - S\u1ea0C NHANH TAI NGHE<br />- Edifier GX7 s\u1eed d\u1ee5ng c\u1ed5ng s\u1ea1c Type-C th\u00f4ng d\u1ee5ng, cho kh\u1ea3 n\u0103ng s\u1ea1c \u0111i\u1ec7n nhanh v\u00e0 k\u1ebft n\u1ed1i thu\u1eadn ti\u1ec7n, d\u1ec5 d\u00e0ng.<br />\u2022 S\u1ea1c nhanh 1 gi\u1edd (tai nghe)/ 1 gi\u1edd (h\u1ed9p s\u1ea1c).</p>\n<p>TH\u00d4NG S\u1ed0 K\u1ef8 THU\u1eacT<br />Phi\u00ean b\u1ea3n Bluetooth: V5.0<br />B\u1ed9 gi\u1ea3i m\u00e3 \u00e2m thanh: LHDC, AAC, SBC<br />\u0110\u01a1n v\u1ecb tr\u00ecnh \u0111i\u1ec1u khi\u1ec3n: Tr\u00ecnh \u0111i\u1ec1u khi\u1ec3n \u0111\u1ed9ng \u03a68mm<br />Th\u1eddi gian ph\u00e1t l\u1ea1i: ANC On: 5H (tai nghe) + 15H (h\u1ed9p s\u1ea1c)<br />ANC T\u1eaft: 6,5H (tai nghe) + 19,5H (h\u1ed9p s\u1ea1c)<br />Th\u1eddi gian s\u1ea1c: kho\u1ea3ng 1 gi\u1edd (tai nghe) / kho\u1ea3ng 1 gi\u1edd (h\u1ed9p s\u1ea1c)<br />Dung l\u01b0\u1ee3ng pin: 40mAh (tai nghe) / 500mAh (v\u1ecf s\u1ea1c)<br />\u0110\u00e1p \u1ee9ng t\u1ea7n s\u1ed1: 20Hz-20kHz<br />M\u1ee9c \u00e1p su\u1ea5t \u00e2m thanh: 94 \u00b1 3dBSPL (A)<br />Tr\u1edf kh\u00e1ng: 24\u03a9<br />C\u1ed5ng s\u1ea1c: USB Type-C</p>",
