      "<p>Loa kh\u00f4ng d\u00e2y Bluetooth EDIFIER 2.0 R1700BT - H\u1ed7 tr\u1ee3 c\u1ed5ng c\u1eafm RCA - C\u00f3 remote \u0111i\u1ec1u khi\u1ec3n - V\u1ecf g\u1ed7 ch\u1ed1ng d\u1ed9i \u00e2m</p>\n<p>TH\u1edcI GIAN GIAO H\u00c0NG SI\u00caU T\u1ed0C \u0110\u1ed8 <br />- \u0110\u01a1n giao h\u1ecfa t\u1ed1c: Th\u1eddi gian t\u1eeb 1- 3 gi\u1edd sau khi x\u00e1c nh\u1eadn \u0111\u01a1n. <br />- \u0110\u01a1n giao b\u00ecnh th\u01b0\u1eddng: Th\u1eddi gian t\u1eeb 1 - 3 ng\u00e0y sau khi x\u00e1c nh\u1eadn \u0111\u01a1n.</p>\n<p>Loa Edifier R1700BT l\u00e0 loa kh\u00f4ng d\u00e2y bluetooth, tuy nhi\u00ean c\u0169ng c\u00f3 h\u1ed7 tr\u1ee3 2 c\u1ed5ng c\u1eafm v\u00e0o c\u00f3 d\u00e2y chu\u1ea9n RCA, \u0111\u1ec3 c\u00f9ng l\u00fac s\u1eed d\u1ee5ng \u0111\u01b0\u1ee3c v\u1edbi nhi\u1ec1u thi\u1ebft b\u1ecb ph\u00e1t nh\u1ea1c kh\u00e1c nhau.</p>\n<p>T\u00cdNH N\u0102NG<br />- S\u1eed d\u1ee5ng Amplifier t\u00edch h\u1ee3p Classs D c\u00f4ng ngh\u1ec7 DSP ( Digital Signal Processing ) v\u00e0 DRC ( Dynamic Range Control ) t\u1ed5ng c\u00f4ng su\u1ea5t l\u00e0 66Watts trong \u0111\u00f3 Loa treble c\u00f3 c\u00f4ng su\u1ea5t 15W * 2 v\u00e0 loa bass c\u00f3 c\u00f4ng su\u1ea5t 18W *2. Loa treble b\u1eb1ng L\u1ee5a v\u1edbi k\u00edch th\u01b0\u1edbc 19mm, loa Bass 4inch. D\u1ea3i t\u1ea7n t\u1eeb 60hz \u0111\u1ebfn 20kHz (@+/- -6dB).</p>\n<p>- Loa c\u00f3 n\u00fat \u0111i\u1ec1u ch\u1ec9nh t\u0103ng gi\u1ea3m \u00e2m l\u01b0\u1ee3ng, Treble, Bass v\u00e0 \u0111i\u1ec1u khi\u1ec3n t\u1eeb xa.</p>\n<p>- Phong c\u00e1ch c\u1ed5 \u0111i\u1ec3n: Thi\u1ebft k\u1ebf nghi\u00eang v\u1edbi g\u00f3c 10 \u0111\u1ed9 \u0111\u1ec3 h\u01b0\u1edbng \u00e2m thanh ch\u00ednh x\u00e1c \u0111\u1ebfn b\u1ea1n. T\u1ea1o ra tr\u1ea3i nghi\u1ec7m nghe t\u1ed1t h\u01a1n v\u00ec n\u00f3 gi\u1ea3m nhi\u1ec5u. R17000BT \u0111\u01b0\u1ee3c \u1ed1p s\u01b0\u1eddn g\u1ed7 cho b\u1ea1n m\u1ed9t c\u00e1i nh\u00ecn d\u1ec5 ch\u1ecbu, c\u1ed5 \u0111i\u1ec3n.</p>\n<p>- K\u1ebft n\u1ed1i smartphone c\u1ee7a b\u1ea1n v\u1edbi loa b\u1eb1ng Bluetooth \u0111\u1ec3 th\u01b0\u1edfng th\u1ee9c \u00e2m nh\u1ea1c kh\u00f4ng d\u00e2y ch\u1ea5t l\u01b0\u1ee3ng cao:<br /> \u00c2n v\u00e0o n\u00fam \u0111i\u1ec1u khi\u1ec3n \u00e2m l\u01b0\u1ee3ng \u0111\u1ec3 ch\u1ecdn ngu\u1ed3n ph\u00e1t<br /> \u1ea4n v\u00e0 gi\u1eef n\u00fam \u0111i\u1ec1u khi\u1ec3n \u00e2m l\u01b0\u1ee3ng \u0111\u1ec3 k\u1ebft n\u1ed1i bluetooth</p>\n<p>- \u0110\u1ea7y \u0111\u1ee7 c\u00e1p k\u1ebft n\u1ed1i \u0111i k\u00e8m<br /> C\u00e1p RCA sang RCA<br /> C\u00e1p 3.5mm sang RCA<br /> C\u00e1p k\u1ebft n\u1ed1i 2 loa</p>\n<p>- K\u1ebft n\u1ed1i \u0111a d\u1ea1ng: <br /> 2 \u0111\u1ea7u v\u00e0o chu\u1ea9n RCA<br /> C\u00f4ng t\u1eafc ngu\u1ed3n c\u00f3 \u0111\u1ed9 b\u1ec1n cao<br /> Gi\u1eafc 4 pin n\u1ed1i qua loa b\u00ean tr\u00e1i<br /> \u0110i\u1ec7n \u00e1p \u0111\u1ea7u v\u00e0o t\u1eeb 100 - 240v</p>\n<p>TH\u00d4NG S\u1ed0 K\u1ef8 THU\u1eacT<br />C\u00f4ng su\u1ea5t:RMS 15W\u00d72 + 18W\u00d72<br />\u0110\u1ed9 \u1ed3n:\u226585dBA<br />T\u1ef7 l\u1ec7 m\u00e9o ti\u1ebfng:\u22640.5%<br />\u0110\u1ed9 nh\u1ea1y \u0111\u1ea7u v\u00e0o:PC:700\u00b150mV\uff0cAUX:550\u00b150mV<br />Tweeter:\u03a619mm silk dome\uff0c6ohm<br />Bass:4\u2033\uff08\u03a6116mm\uff09\uff0c6ohm<br />K\u00edch th\u01b0\u1edbc:154mm\u00d7254mm\u00d7214mm\uff08W\u00d7H\u00d7D\uff09<br />C\u00e2n n\u1eb7ng:6.6kg</p>\n<p>\u00a0</p>",
